  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115256 includes chemical,
  meteorological, physical and underway - surface data collected from JAMES CLARK
  ROSS in the Arctic Ocean, Barents Sea, North Atlantic Ocean, North Greenland Sea,
  North Sea, Norwegian Sea, South Atlantic Ocean and South Pacific Ocean from 2012-11-15
  to 2013-08-16 and retrieved during cruise 74JC20121115. These data include AIR-SEA
  DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE,
  CARBON DIOXIDE - AIR, Partial pressure (or fugacity) of carbon dioxide, SALINITY
  and SEA SURFACE TEMPERATURE. The instruments used to collect these data include
  Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer, Shower head chamber
  equilibrator for autonomous carbon dioxide (CO2) measurement and thermosalinographs.
  These data were collected by Dr. Vassilis Kitidis of Plymouth Marine Laboratory
  as part of the VOS_James_C_Ross_2013 data set.nnThe Global Volunteer Observing Ship
  (VOS) Program is coordinated by the UNESCO International Ocean Carbon Coordination
  Project (IOCCP). International groups from 14 countries have been outfitting research
  ships and commercial vessels with automated CO2 sampling equipment to analyze the
  carbon exchange between the ocean and atmosphere.\",\n\t\"license_title\": null,\n\t\"extras\":
